import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import './style/styles.css';
import { GoogleLogin } from 'react-google-login';

const Login = () => {
  const navigate = useNavigate();
  const [loginStatus, setLoginStatus] = useState(null);

  const handleGoogleLoginSuccess = (response) => {
    // Handle successful Google login here
    console.log('Google Login Success:', response);
  };

  const handleGoogleLoginFailure = (error) => {
    // Handle failed Google login here
    console.error('Google Login Error:', error);
  };

  const handleRegister = () => {
    // Redirect to the registration page
    navigate('/register');
  };

  return (
    <div className="login-main">
      <h2>Login</h2>

      {/* Google Login Button */}
      <GoogleLogin
        clientId="916183960867-podcm2n2nil1q66r019e53o02d8obb2h.apps.googleusercontent.com"
        buttonText="Login with Google"
        onSuccess={handleGoogleLoginSuccess}
        onFailure={handleGoogleLoginFailure}
        cookiePolicy={'single_host_origin'}
      />

      <div className="register-link">
        Not a user? <a href="/register" onClick={handleRegister}>Register now</a>
      </div>
    </div>
  );
};

export default Login;
